description: >-
  A night of Latin flavor in Munich: Join our Havana Nights party and let
  yourself be carried away by the rhythm of Cuban Salsa. The dance floor will be
  illuminated with vibrant colors, and the music will transport you to the
  warmth of the Caribbean.


  Our DJ specialized in Latin music will make you dance the night away with the most contagious rhythms.


  In addition, you can enjoy delicious tropical cocktails and Latin appetizers that will take you directly to Havana. Don't miss this unique experience in Munich and feel the passion of Latin music!
